import React, { useState } from "react";
import { fetchContributionData } from "../services/fetchCommits";
import "../styles/styles.css";

const Dashboard = () => {
    const [selectedOrg, setSelectedOrg] = useState("");
    const [selectedRepo, setSelectedRepo] = useState("");
    const [selectedUser, setSelectedUser] = useState("");
    const [contributions, setContributions] = useState([]);

    // ðŸ”¹ ORGANIZATION & REPOSITORY MAPPING
    const ORGANIZATIONS = {
        "HWAI-MarketIntel": ["EnrollmentTrendsUI-R4", "EnrollmentTrendsAPI-R4", "CompetitorAnalysisUI-R1", "CompetitorAnalysisAPI-R1"],
        "HWAI-NetworkIntel": ["PNCOneToManyUI-R1", "PNCOneToManyAPI-R1", "NetworkAdequacyUI-R1", "NetworkAdequacyAPI-R1", "NPISearchUI-R4", "ProviderNetworkComparisonUI-R4", "ProviderNetworkComparisonAPI-R4", "NPISearchAPI-R4"],
        "HWAI-XAI": ["ProductScorecardUI-R1", "BenefitSimulatorUI-R3.1", "BenefitSimulatorAPI-R3.1", "BenefitSimulatorAPI-R3", "ProductScorecardAPI-R1", "BenefitSimulatorUI-R3"],
        "HWAI-ProductIntel": ["ChatbotEOCUI-R1", "ChatbotEOCAPI-R1", "ChatbotEOCModel-R1", "PlanComparisonUI-R4", "PlanComparisonAPI-R4"],
        "HWAI-CST": ["LobbyClientUI-R1", "LobbyAdminServerAPI-R1", "LobbyHeartbeatAutomationUI-R1", "HubspotIntegrationAPI-R1", "LobbyMiddlewareAPI-R1", "LobbyAdminPanelUI-R1", "LobbyServerAPI-R1"]  // âœ… Added CST
    };

    // ðŸ”¹ USERS MAPPING BASED ON ORGANIZATION
    const USERS_BY_ORG = {
        "HWAI-MarketIntel": ["ArunPrem_APP", "Mukul Kumar", "bindu-e"],
        "HWAI-NetworkIntel": ["Rajeev Rawat", "satyajeet-HealthworksAI", "vidushi-chaudhary"],
        "HWAI-XAI": ["Promod Kr Verma", "suneelkumar02", "deepesh-tech"],
        "HWAI-ProductIntel": ["vibhore-go", "Kritika-sharma12", "ankit_sde@hwai"],
        "HWAI-CST": ["ArulTEG", "ArunPrem_APP", "deepesh-tech", "Mukul Kumar", "suneelkumar02", "dhorinaresh"]  // âœ… CST users only when CST is selected
    };

    const handleFetchData = async () => {
        if (!selectedOrg || !selectedRepo || !selectedUser) {
            alert("âš  Please select an Organization, Repository, and User!");
            return;
        }
        const data = await fetchContributionData(selectedOrg, selectedRepo, selectedUser);
        setContributions(data);
    };

    return (
        <div className="dashboard-container">
            <h1>GitHub Contributions Dashboard</h1>

            <div className="filter-container">
                {/* Organization Filter */}
                <select value={selectedOrg} onChange={(e) => setSelectedOrg(e.target.value)}>
                    <option value="">-- Select Organization --</option>
                    {Object.keys(ORGANIZATIONS).map(org => (
                        <option key={org} value={org}>{org}</option>
                    ))}
                </select>

                {/* Repository Filter */}
                <select value={selectedRepo} onChange={(e) => setSelectedRepo(e.target.value)} disabled={!selectedOrg}>
                    <option value="">-- Select Repository --</option>
                    {selectedOrg && ORGANIZATIONS[selectedOrg].map(repo => (
                        <option key={repo} value={repo}>{repo}</option>
                    ))}
                </select>

                {/* User Filter */}
                <select value={selectedUser} onChange={(e) => setSelectedUser(e.target.value)} disabled={!selectedOrg}>
                    <option value="">-- Select User --</option>
                    {selectedOrg && USERS_BY_ORG[selectedOrg].map(user => (
                        <option key={user} value={user}>{user}</option>
                    ))}
                </select>

                {/* Execute Button */}
                <button onClick={handleFetchData}>Execute</button>
            </div>

            {/* Contribution Data Table */}
            <div className="contribution-table">
                <table>
                    <thead>
                        <tr>
                            <th>Commit ID</th>
                            <th>Message</th>
                            <th>Date</th>
                        </tr>
                    </thead>
                    <tbody>
                        {contributions.length === 0 ? (
                            <tr><td colSpan="3">No data available</td></tr>
                        ) : (
                            contributions.map((entry, index) => (
                                <tr key={index}>
                                    <td>{entry.commit_id}</td>
                                    <td>{entry.message}</td>
                                    <td>{new Date(entry.date).toLocaleString()}</td>
                                </tr>
                            ))
                        )}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default Dashboard;
